module.exports = "<!DOCTYPE html>\r<html>\r  <head>\r    <meta http-equiv=\"content-type\" content=\"text/html; charset=UTF-8\">\r    <title>MML Help</title>\r  </head>\r  <body>\r    <div style=\"margin: 0 auto; width: 80%;\">\r      <h1>Mapping&nbsp;My&nbsp;Life - Aide Utilisateur</h1>\r      <h2>Données utilisées</h2>\r      <p>Elles sont récupérées par le connecteur «&nbsp;Orange Mobile – Appels\r        &amp;&nbsp;Géoloc&nbsp;» que vous devez activer au préalable.</p>\r      <p>Deux types de données sont affichés dans cette application&nbsp;:</p>\r      <ol>\r        <li>les localisations au moment des appels et SMS émis ou reçus depuis\r          votre mobile&nbsp;;</li>\r        <li>les localisations toutes les demi-heures, lorsque vous avez\r          explicitement accepté cette option dans le connecteur.</li>\r      </ol>\r      <p>Les coordonnées de cette localisation sont celles de l’antenne radio\r        sur laquelle votre mobile était connecté.</p>\r      <p>Ces données&nbsp;&nbsp;sont mises à jour sur les serveurs\r        d’Orange&nbsp;:</p>\r      <p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;toutes les\r        2 semaines pour les données de type 1&nbsp;;</p>\r      <p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;toutes les\r        30 minutes pour celles de type 2.</p>\r      <p>Elles sont téléchargées par le connecteur dans\r        votre&nbsp;Cozy&nbsp;automatiquement une fois par semaine, ou\r        manuellement à tout moment en cliquant sur le lien «&nbsp;SYNCHRONISER\r        MAINTENANT&nbsp;» de l’onglet de synchronisation du connecteur.</p>\r      <h2>Carte générale</h2>\r      <p>Dans chacun des onglets, un fond de carte est présenté.</p>\r      <p>Vous pouvez naviguer dans cette carte</p>\r      <p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;en la\r        faisant glisser à l’aide de la souris&nbsp;: utiliser pour cela le\r        bouton de gauche et le gardant appuyé&nbsp;;</p>\r      <p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;en zoomant\r        sur la zone, soit à l’aide des boutons «&nbsp;+ / -&nbsp;»&nbsp; en haut\r        à gauche, soit grâce à la molette de votre souris.</p>\r      <h2>Onglet «&nbsp;Home&nbsp;»</h2>\r      <p>Cette carte affiche l’ensemble des endroits où votre mobile a été\r        localisé pour une période donnée.</p>\r      <p>Sous la carte, une&nbsp;timeline&nbsp;est affichée dans laquelle sont\r        représentés&nbsp;:</p>\r      <p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;dans la\r        ligne «&nbsp;Geoloc&nbsp;», les points où votre mobile a été localisé à\r        la demi-heure&nbsp;(données de type 2)&nbsp;;</p>\r      <p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;dans la\r        ligne «&nbsp;PhoneCommunication&nbsp;», les points où votre mobile a\r        émis ou reçu des appels ou des SMS&nbsp;(données de type 1).</p>\r      <p>Par défaut, cette&nbsp;timeline&nbsp;affiche les deux derniers jours,\r        mais vous pouvez modifier la période observée à l’aide des boutons verts\r        situés à sa droite&nbsp;:</p>\r      <p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;«&nbsp;+ /\r        -&nbsp;» allonge ou restreint la période&nbsp;;</p>\r      <p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;«&nbsp;&lt;\n        / &gt;&nbsp;» déplace la période.</p>\r      <p>En passant le pointeur de souris sur chaque point dans\r        la&nbsp;timeline, un pop-up s’affiche avec la position et l’heure, ainsi\r        que le type d’usage (appel ou SMS) pour la ligne «&nbsp;Phone\r        Communication&nbsp;». En cliquant sur un de ces points, la carte se\r        déplace pour se centrer sur lui.</p>\r      <p>Lorsque le mobile a été localisé plusieurs fois à un endroit, une icône\r        sur la carte indique la position et le nombre de fois où il a été vu par\r        le réseau.</p>\r      <p>Les points sont regroupés avant l’affichage, selon leur proximité et le\r        niveau de zoom que vous utilisez&nbsp;: si vous zoomez ou dé-zoomez, le\r        niveau de détail est modifié.</p>\r      <p>En cliquant sur ces icônes représentées sur la carte, vous pouvez\r        afficher la liste des localisations qui ont été regroupées, chacune item\r        de la liste donnant le jour et l’heure où le mobile a été vu par le\r        réseau (via les boutons «&nbsp;Affiche&nbsp;» / «&nbsp;Cache&nbsp;»).</p>\r      <h2>Onglet « Favoris »</h2>\r      <p>Cette carte affiche un regroupement de l’ensemble des points où votre\r        mobile a été localisé durant toute la période d’observation.</p>\r      <p>Chaque icône représente un lieu que vous fréquentez souvent. Les 10\r        lieux les plus&nbsp;fréquentés (5 pour chaque type de données)&nbsp;sont\r        représentés et peuvent être libellés comme&nbsp;Maison, Travail, Sport,\r        Marché ou Autre (que vous pouvez préciser).</p>\r      <p>Pour libeller un lieu, cliquez sur son icône sur la carte, puis\r        choisissez son type puis utilisez l’un des boutons «&nbsp;Ajouter&nbsp;»\r        / «&nbsp;Modifier&nbsp;» / «&nbsp;Supprimer&nbsp;».</p>\r      <p>Remarque&nbsp;: un bug en cours de traitement empêche temporairement\r        l’affichage de la chaîne de caractères entrée dans «&nbsp;Autre&nbsp;».</p>\r      <h2>Onglet « Itineraire »</h2>\r      <p>Cette carte affiche l’ensemble de vos trajets sur une journée.</p>\r      <p>Vous devez d’abord choisir une date en cliquant dans la zone de texte\r        prévue à cet effet et en la sélectionnant dans le calendrier affiché,\r        puis cliquer sur le bouton «&nbsp;Display&nbsp;».</p>\r      <p>Le trajet affiché utilise l’ensemble des données disponibles pour la\r        journée&nbsp;choisie (données de type 1 et de type 2)&nbsp;et une\r        animation vous donne le sens de circulation.</p>\r    </div>\r  </body>\r</html>\r";

